import React from "react"
import {nanoid} from "nanoid"
import StartUp from "./Components/StartUp"
import Questions from "./Components/Questions"


export default function App() {
  const [start, setStart] = React.useState(false)

  function startQuiz() {
    setStart(true)
  }

  return (
    <div>
      {
      start === false 
      ? 
      <StartUp 
        start={startQuiz}
      />
      :
      <Questions />
    }
    </div>
  )
}
